import React from "react";

function PokeList({ pokemon }) {
    return (
        <div>
            {pokemon.map(p => (
                <div className="poke-div" key={p}>{p} <img src={p.sprites}/></div>
            ))}
        </div>
    )
}

export default PokeList;
